import React from "react";

export default function RegForm() {
    return (
        <>
            <section className="container-fluid mt-3">
                <div className="row">
                    <div className="col-5 m-auto">
                        <div className="card">
                            <div className="card-header">
                                <h1></h1>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
}
